import { Component } from '@angular/core';
import * as monaco from 'monaco-editor';

@Component({
  selector: 'app-editor-pane',
  standalone: false,
  templateUrl: './editor-pane.html',
  styleUrls: ['./editor-pane.scss'],
})
export class EditorPane {
  language = 'javascript';
  code = '';
  output = '';

  editorOptions: monaco.editor.IStandaloneEditorConstructionOptions = {
    language: this.language,
    theme: 'igknight-dark',
    automaticLayout: true,
    fontSize: 14,
    minimap: { enabled: false },
  };

  ngOnInit() {
  monaco.editor.defineTheme('igknight-dark', {
    base: 'vs-dark',
    inherit: true,
    rules: [],
    colors: {
      'editor.background': '#0f172a',
      'editor.foreground': '#113f6eff',
      'editorLineNumber.foreground': '#64748b',
      'editorLineNumber.activeForeground': '#f97316',
      'editorCursor.foreground': '#f97316',
      'editor.selectionBackground': '#33415588',
      'editor.lineHighlightBackground': '#1e293b',
    },
  });
}

  onEditorInit() {
    
    monaco.editor.setTheme('igknight-dark');
  }

  onLanguageChange(lang: string) {
    this.language = lang;
    this.editorOptions = {
      ...this.editorOptions,
      language: lang,
    };
  }

  runCode() {
    this.output = '// Sample output from execution';
  }

  resetCode() {
    this.code = '';
  }

  copyCode() {
    navigator.clipboard.writeText(this.code);
  }

  expandEditor() {
    console.log('Expand editor clicked');
  }

  openSettings() {
    console.log('Settings clicked');
  }
}
<div class="rounded-xl bg-[#131c2b] text-white p-4 space-y-4 shadow-lg">
  <!-- Top Toolbar -->
  <div class="flex justify-between items-center">
    <!-- Language Dropdown -->
    <div class="flex items-center gap-3">
      <label class="text-sm font-medium">Language:</label>
      <select
        class="bg-[#2e2e2e] text-white px-3 py-1 rounded-md text-sm focus:outline-none"
        [(ngModel)]="language"
        (change)="onLanguageChange(language)"
      >
        <option value="javascript">JavaScript</option>
        <option value="typescript">TypeScript</option>
        <option value="python">Python</option>
        <option value="csharp">C#</option>
        <option value="cpp">C++</option>
      </select>
    </div>

    <!-- Right Toolbar Buttons -->
    <div class="flex gap-3 items-center text-sm">
      <button
        class="text-gray-300 hover:text-white transition"
        (click)="resetCode()"
      >
        â†» Reset Code
      </button>
      <button
        class="text-gray-300 hover:text-white transition"
        (click)="copyCode()"
      >
        ðŸ“‹ Copy
      </button>
      <button
        class="bg-orange-500 hover:bg-orange-600 text-white px-4 py-1.5 rounded-md font-semibold transition"
        (click)="runCode()"
      >
        â–¶ Run
      </button>
    </div>
  </div>

  <!-- Monaco Code Editor -->
  <div class="relative">
    <!-- Expand & Settings icons (positioned top-right inside editor) -->
    <div class="absolute right-2 top-2 z-10 flex gap-2">
      <button class="text-gray-400 hover:text-white" (click)="expandEditor()">
        â†—
      </button>
      <button class="text-gray-400 hover:text-white" (click)="openSettings()">
        âš™
      </button>
    </div>

    <ngx-monaco-editor
      [options]="editorOptions"
      [(ngModel)]="code"
      class="h-[400px] w-full border border-gray-700 rounded-md overflow-hidden"
    ></ngx-monaco-editor>
  </div>

  <!-- Bottom Tab Section (simplified for now) -->
  <div class="flex items-center text-sm text-gray-400 border-t border-gray-700 pt-2">
    <div class="mr-6 font-semibold text-white border-b-2 border-orange-500 pb-1">
      Test Cases (0)
    </div>
    <div class="mr-6 hover:text-white cursor-pointer">Console</div>
    <div class="hover:text-white cursor-pointer">Output</div>
  </div>

  <!-- Hint/Message -->
  <div class="text-center text-sm text-gray-500">
    Run your code to see test results
  </div>

  <!-- Output Display -->
  <div class="bg-[#2a2a2a] text-green-400 p-4 rounded-md font-mono text-sm">
    <div class="mb-1 font-bold text-white">Output:</div>
    <pre class="whitespace-pre-wrap">{{ output }}</pre>
  </div>
</div>
